import React, { Component } from 'react'
import './index.css'

export default class index extends Component {
  render() {
    return (
      <div>
        <div className="todo-footer">
            <label>
              <input type="checkbox"/>
            </label>
            <span>
              <span>Finished: 0</span> / All: 2
            </span>
            <button className="btn btn-danger">Delete all todos</button>
          </div>
      </div>
    )
  }
}
